    <script>
      document.addEventListener("DOMContentLoaded", function () {
        // Get the carousel element
        const carousel = document.querySelector(".Carousel");

        // Get the navigation buttons using appropriate selectors
        const arrowButtons = document.querySelectorAll(".Arrow");

        // Ensure there are two arrow buttons (previous and next)
        if (arrowButtons.length === 2) {
          const prevButton = arrowButtons[0];
          const nextButton = arrowButtons[1];

          // Add event listeners to the navigation buttons
          prevButton.addEventListener("click", () => {
            previousCard();
          });

          nextButton.addEventListener("click", () => {
            nextCard();
          });
        }

        // Get the dots navigation
        const dots = document.querySelectorAll(".Dot");

        // Add event listeners to the dots navigation
        dots.forEach((dot, index) => {
          dot.addEventListener("click", () => {
            navigateToCard(`card-${index + 1}`);
          });
        });

        // Define the functions to navigate the carousel
        function previousCard() {
          if (carousel) {
            const scrollLeft = carousel.scrollLeft;
            const clientWidth = carousel.clientWidth;
            carousel.scrollTo({
              left: scrollLeft - clientWidth,
              behavior: "smooth",
            });
          }
        }

        function nextCard() {
          if (carousel) {
            const scrollLeft = carousel.scrollLeft;
            const clientWidth = carousel.clientWidth;
            carousel.scrollTo({
              left: scrollLeft + clientWidth,
              behavior: "smooth",
            });
          }
        }

        function navigateToCard(id) {
          const card = document.getElementById(id);
          if (card) {
            card.scrollIntoView({
              behavior: "smooth",
              block: "center",
              inline: "nearest",
            });
          }
        }
      });
    </script>
